    it('Contour Line Labels', () => {
      const options = {
        port: 3000,
        host: 'localhost',
        method: 'POST'
      };

      const req = http.request(options);
      // Data taken from https://plotly.com/javascript/contour-plots/#contour-line-labels example.
      const payload = `{
                         "data": [
                           {
                             "z": [ [ 10, 10.625, 12.5, 15.625, 20 ],
                                    [ 5.625, 6.25, 8.125, 11.25, 15.625 ],
                                    [ 2.5, 3.125, 5, 8.125, 12.5 ],
                                    [ 0.625, 1.25, 3.125, 6.25, 10.625 ],
                                    [ 0, 0.625, 2.5, 5.625, 10 ]
                                  ],
                             "type": "contour",
                             "contours": {
                               "coloring": "heatmap",
                               "showlabels": true,
                               "labelfont": {
                                 "family": "Raleway",
                                 "size": 12,
                                 "color": "white"
                               }
                             }
                           }
                         ],
                         "layout": {
                           "title": {
                             "text": "Contour with Labels"
                           }
                         }
                       }`;
      req.write(payload);
      req.end();

      req.on('response', (response) => {
        assert.strictEqual(500, response.statusCode);
        let body = '';
        response.on('data', (chunk) => {
          body += chunk;
        });
        response.on('end', () => {
          // Browser-based answer is an SVG with embedded binary PNG image data
          // (due to heatmap colouring).

          // Currently, the server cannot handle that and returns HTTP status code 500.
          // Reasons seem to be the heatmap colouring and the labels.
          assert.ok(body == '{"success":false,"failure":"promise-rejected"}');
        });
      });
    });

